import React from "react";
import column_block_title from './column_block_title';
import column_block_experience from './column_block_experience';
import column_block_edu from './column_block_edu';
import column_block_intro from './column_block_intro';
import './column_block.css';

class column_block extends Component{
    constructor(props){
        super(props);
        this.state = {
            title:this.props.content.title,
            experience: this.props.content.experience,
            edu: this.props.content.edu,
            intro:this.props.content.intro,
            id: this.props.content.id,
        }
    }
    render(){
        return(
            <div id={`${this.state.id}_content`} class="column_content">
                <div id = "column_content_space">
                    <column_block_title id={`${this.state.id}_title`} title={this.state.title}/>
                    <column_block_experience id={`${this.state.id}_experience`} hashtags={this.state.experience}/>
                    <column_block_edu id={`${this.state.id}_edu`} sections={this.state.edu}/>
                    <column_block_intro id={`${this.state.id}_intro`} annotation={this.state.intro}/>
                </div>
            </div>
        )
    }
}

export default column_block
